import React from 'react';

// Import your styles here, if you've separated them for the home page
import '../styles/landing_page.css';
import '../styles/header_EU.css';
import '../styles/stylesheet.css';

// Import any images or assets you need
//import lozanoImage from '../images/Lozano.png';
//import gregNewsroom from '../images/greg_newsroom.jpg';
//import emmyImage from '../images/emmy.jpg';
//import jessieImage from '../images/jessie.PNG';

const Home = () => {
    return (
        <div className="BODY">
            <div className="container-fluid TOP">
                <header className="header_EU">
                    {/* ... rest of the header content ... */}
                </header>
                <main className="row middle-section text-center">
                    {/* ... rest of the main content ... */}
                </main>
                <section className="row lozano-section">
                    {/* ... rest of the section content ... */}
                </section>
            </div>

            <section className="container-fluid bottomTwo">
                {/* ... rest of the About E&U section content ... */}
            </section>

            <section className="container-fluid news-section">
                <div className="row">
                    <div className="col text-center">
                        <div className="titleBottomThree">Energy and U Highlights</div>
                    </div>
                </div>
                <div className="row news-container">
                    <div className="col-md-4 news-item">
                        <div className="news-image">
                            <img src={gregNewsroom} alt="News Image" />
                        </div>
                        {/* ... rest of the news section content ... */}
                    </div>
                    <div className="col-md-4 news-item">
                        <div className="news-image">
                            <img src={emmyImage} alt="News Image 2" />
                        </div>
                        {/* ... rest of the news section content ... */}
                    </div>
                    <div className="col-md-4 news-item">
                        <div className="news-image">
                            <img src={jessieImage} alt="News Image 3" />
                        </div>
                        {/* ... rest of the news section content ... */}
                    </div>
                </div>
            </section>

            <footer className="py-4 bg-dark text-white mt-5">
                <div className="container">
                    <p className="m-0 text-center">&copy; 2022 Energy & U. All Rights Reserved.</p>
                </div>
            </footer>
        </div>
    );
}

export default Home;
